import './main.css';
import './processing.css';
function Processing() {
  return (
    <div>
      <h1 class="top-heading"> <img
        src={`${process.env.PUBLIC_URL}/fyp-images/iconmusic.webp`}
        width="50"
        height="55"
        alt="MoodMelody Logo"
      /> MoodMelody </h1>
      <p class="top-Description">AI processing in Progress</p>
<div className="uploads-flex">
      <img
        src={`${process.env.PUBLIC_URL}/fyp-images/vedio.jpg`}
        alt="Vedio"
        class="vedio-icon"
      />   

      <h3 class="keyword-heading">Keyword=" "</h3>
</div>

    </div>
  );
}
export default Processing;
